    jobDescription:
      "Software Developers at IBM are the backbone of our strategic initiatives to design, code, test, and provide industry-leading solutions that make the world run today - planes and trains take off on time, bank transactions complete in the blink of an eye and the world remains safe because of the work our software developers do. Whether you are working on projects internally or for a client, software development is critical to the success of IBM and our clients worldwide. At IBM, you will use the latest software development tools, techniques and approaches and work with leading minds in the industry to build solutions you can be proud of.<br /><span></span><br /><span>Your Role and Responsibilities</span><span></span><br /><span><span><span><span><span><span>Your Role and Responsibilities</span></span></span></span></span></span><br /><span><span><span><span><span><span>IBM is trailblazing new cloud technologies and services that span key technology areas that includes Security Services, Business Support Systems, and Identity and Access Management capabilities running on IBM s industry leading Containers platform. We are looking for experienced candidates with a broad array of full-stack development skills that span both backend, UI development, test automation and DevOps. As a software engineer, the ideal candidate must bring a deep level of experience designing, implementing, and troubleshooting modern cloud services. In addition, they are accountable as individuals and organizational leaders for delivering value by bringing relevant technology domain and implementation ability in topics aligned with the cloud platform integration, orchestration/provisioning, security, and DevOps. Cloud software developers are also expected to aid in the gathering of business and technical requirements, implement specific technologies while demonstrating progress on a regular basis, and work with technical leads or project managers to identify and overcome technical blockers. </span></span></span></span></span></span><br /><span><span><span><span><span><span>Who You Are:</span></span></span></span></span></span><br /><span><span><span><span><span><span>The IBM RegTech Cloud Team is looking for a talented, innovative, and enthusiastic Cloud DevOps professional that will build the next generation cloud and security services to make our customers succeed. </span></span></span></span></span></span><br /><span><span><span><span><span><span>What You Will Do: </span></span></span></span></span></span><br /><span><span><span><span><span><span>IBM Cloud has a global cloud presence that continues to grow and expand its reach. Our Cloud Platform engineering team handles delivering Platform services with top-notch performance, first-rate security, fail-safe reliability and exceptional quality. An IBM Cloud DevOps engineer will be the key individual responsible for development of DevOps, Security, Monitoring tooling, for new cloud services on the IBM Cloud Platform. You will get to work with Fortune 100 Enterprise clients and build hyperscale cloud services for the largest companies in the world. We are a global team, so communication skills (both verbal and written) are critical as well as flexibility to collaborate with team members in other time zones. </span></span></span></span></span></span><p></p><p><span>Required Technical and Professional Expertise</span><span></span><br /><span><span></span></span><br /><span><span><span><span>About 2-3 years of experience in the role of DevOps engineer. Experience building DevOps tooling for a truly distributed architecture-based system will be huge plus. </span></span></span></span><br /><span><span><span><span>Experience in multiple of the following areas is required: </span></span></span></span></p><ul><li>Strong understanding of DevOps practices & tools, logging and monitoring tools </li><li>Experience implementing distributed applications in a container environment (Docker/Kubernetes/OpenShift) </li><li>Strong RDBMS (DB2) systems experience is desired </li><li>We believe in automating everything, and the expectation is to create automated/automatable solutions. </li><li>Caching is a key skill in the cloud, and a strong candidate will show exceptional skills with local and edge caching solutions. </li><li>The ability to debug web-based solutions on both client and server sides would be a skill of the preferred candidate </li><li>Having hands on experience with designing and developing microservices is also preferred. </li></ul><p><span>Preferred Technical and Professional Expertise</span><span></span></p><ul><li>Passion for DevOps, Security, and interest in learning emerging technologies </li><li>Working knowledge on any of NodeJS, GitHub, python, Ansible and Java. </li><li>Familiarity with Jenkins as build driving a full unit test, build verification, and production code delivery pipeline. </li><li>Ability to stand up and configure software solutions in a cloud environment. </li><li>Candidates are expected to be self-starting and self-motivating Individuals. </li><li>Agile development Experience. </li><li>A security minded individual is needed. </li><li>You Should be Passionate About learning: </li><li>Delivery pipeline for CI / CD / Ops </li><li>Integration with Monitoring and Logging tools </li><li>Gather insights from alerts and logs </li><li>Provide clear and advance communication to clients, colleagues and stakeholders about upcoming system changes </li><li>Take initiative to improve customer experience in using advanced technics, new technologies judiciously to reduce complexity </li></ul>",
